INSERT INTO `wp_posts` VALUES ('42', '1', '2018-01-10 16:08:52', '2018-01-10 16:08:52', '<h2>Join SECWAC</h2>\nSoutheast Connecticut World Affairs Council is a regional membership organization. Our members include a diverse group of regional citizens with backgrounds in education, medicine, law, business, academia, media, humanitarian, civic organizations, and beyond. Government officials as well as active ­duty and retired military personnel are also active members. SECWAC happily accepts those interested in foreign policy and world affairs from any walk of life.\n<h2>Rates</h2>\n2017-2018 annual membership dues for 8-10 annual events are:\n<ul>\n 	<li>$75 for individual membership</li>\n 	<li>$25 for Young Professionals under 35</li>\n 	<li>Free for area students.</li>\n</ul>\n<h2>Guest Program</h2>\nMembers are encouraged to refer friends and colleagues for membership who share an interest in discussing and educating themselves and others on world affairs.\nA guest of a member may attend once as a complimentary guest; thereafter, the guest/walk-in rate is $20 per person.\n<h2>Member Benefits</h2>', 'Membership', '', 'inherit', 'closed', 'closed', '', '18-autosave-v1', '', '', '2018-01-10 16:08:52', '2018-01-10 16:08:52', '', '18', 'http://secwac.local/2018/01/10/18-autosave-v1/', '0', 'revision', '', '0'); 
INSERT INTO `wp_posts` VALUES ('43', '1', '2018-01-10 16:09:30', '2018-01-10 16:09:30', '<h2>Join SECWAC</h2>\r\nSoutheast Connecticut World Affairs Council is a regional membership organization. Our members include a diverse group of regional citizens with backgrounds in education, medicine, law, business, academia, media, humanitarian, civic organizations, and beyond. Government officials as well as active ­duty and retired military personnel are also active members. SECWAC happily accepts those interested in foreign policy and world affairs from any walk of life.\r\n<h2>Rates</h2>\r\n2017-2018 annual membership dues for 8-10 annual events are:\r\n<ul>\r\n 	<li>$75 for individual membership</li>\r\n 	<li>$25 for Young Professionals under 35</li>\r\n 	<li>Free for area students.</li>\r\n</ul>\r\n<h2>Guest Program</h2>\r\nMembers are encouraged to refer friends and colleagues for membership who share an interest in discussing and educating themselves and others on world affairs.\r\nA guest of a member may attend once as a complimentary guest; thereafter, the guest/walk-in rate is $20 per person.\r\n<h2>Member Benefits</h2>\r\n<ul>\r\n 	<li>8-10 speaker series events between September and June.</li>\r\n 	<li>One complimentary guest at any speaker event.</li>\r\n 	<li>Following most events, members can join the speaker for an intimate dinner and conversation for\r\n$35/person.</li>\r\n 	<li>SECWAC members are also members of the World Affairs Councils of America, the largest nonpartisan, nonprofit grassroots organization in the United States dedicated to educating and engaging the American public on global issues. Members may attend their Annual Conference in Washington D.C., which takes place each November. Over 500,000 people a year benefit from the network programming, including members and participants.</li>\r\n 	<li>WACA members also get access to Weekly Worldwide News of Importance.</li>\r\n 	<li>Access to Worldwide Travel Tours - land tours and small-ship cruises with fellow WACA members.</li>\r\n 	<li>For students, SECWAC membership is a great resume builder for college applicants and relates to many studies - from history to political science. Learn more about student benefits here.</li>\r\n 	<li>And more!</li>\r\n</ul>', 'Membership', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-01-10 16:09:30', '2018-01-10 16:09:30', '', '18', 'http://secwac.local/2018/01/10/18-revision-v1/', '0', 'revision', '', '0'); 
